import React, { Component } from "react";
import { NavLink } from 'react-router-dom';
import Logo from "../img/logo.png";
import "./NavBar.css";

class NavBar extends Component {

// const NavBar = () => {
  render() {
  return (
    <div>
      <div className="topbar"></div>
        <h1 className="header"> COVID-19 SIR Model and Visualizations</h1>
        <br />
        <br/>

        <div className="container">
            <div className="row mx-n5">
                <div className="col-md-3">
                    <NavLink className="navbar-brand" to={appRoutes.home}>
                        <img id="logo" src={Logo} className="mx-auto d-block" alt="Logo" />
                    </NavLink>
                </div>
                <div className="col-md-6">
                    <h1> Scotty Shirts U Illustrate (SSUI) </h1>
                </div>
                <div className="col-md-3" id="wrapper">
                    <div id="wrapper">
                        <NavLink className="nav-link" to={appRoutes.cart}>
                            <img id="cart" src={Cart} className="mx-auto d-block" alt="Logo" />
                            <div id="quant"> <p> {this.props.quant} </p> </div>
                        </NavLink>
                        {/* <p id="quant"> {this.props.quant} </p> */}
                    </div>
                </div>
            </div>
        </div>

        <NavLink 
        to="/">
          <button className="nav">Home</button>
        </NavLink>

        <NavLink 
        to="/new">
          <button className="nav">Create a New Collection</button>
        </NavLink>
    </div>


  )}
};

export default NavBar;
